import React from "react";
import {useNavigate} from "react-router-dom";

export const HomePage = () => {
    const IrParaListaDeViagens = () => {
        const navigate = useNavigate()
        navigate("/trips/list")
    }
    return (
        <div>
            <p>HomePage</p>
            <button onClick={IrParaListaDeViagens}>Viagens</button>
        </div>
    )
}
